import React from 'react';

const Baskets = (props) => {
  const { cartItems, onAdd } = props;

  return (
    <div>
      {' '}
      <h2>Cart Items</h2>
      <div>{cartItems.length === 0 && <div>Cart Is Empty</div>}</div>
      {cartItems.map((item) => (
        <div key={item.id}>{item.name}</div>
      ))}
    </div>
  );
};

export default Baskets;
